import Hero from "./components/Hero"
import Logo from "./components/Logo"

const App = () => {
  return (
    <>
      <main>
        <Logo/>
        <Hero/>

        <form className="flex items-center justify-center mt-10">
          <input className="py-2 px-5 rounded" type="text" name="text" placeholder="Enter your todo item">
          </input>
        </form>

      </main>
    </>
  );
}

export default App;
